pragma solidity ^0.4.19;

contract RockPaperScissors {
  event GameCreated(address creator, uint16 gameNumber, uint256 bet);
  event GameStarted(address[2] players, uint16 gameNumber);
  event GameComplete(address winner, uint16 gameNumber);

  Game[] games;

  struct Game {
    address p1;
    address p2;
    uint8 move;
    uint256 bet;
  }

  /**
 * Use this endpoint to create a game.
 * It is a payable endpoint meaning the creator of the game will send ether directly to it.
 * The ether sent to the contract should be used as the bet for the game.
 */
  function createGame(address participant) public payable {
    Game memory g = Game(msg.sender, participant, 0, msg.value);
    games.push(g);
    uint16 gameNumber = uint16(games.length - 1);
    GameCreated(msg.sender, gameNumber, msg.value);
  }

  /**
 * Use this endpoint to join a game.
 * It is a payable endpoint meaning the joining participant will send ether directly to it.
 * The ether sent to the contract should be used as the bet for the game.
 * Any additional ether that exceeds the original bet of the creator should be refunded.
 */
  function joinGame(uint16 gameNumber) public payable {
    Game memory g = games[gameNumber];
    uint256 oBet = g.bet;
    uint256 newBet = msg.value;
    require(newBet >= oBet && msg.sender == g.p2);
    if(newBet > oBet){
      msg.sender.transfer(newBet - oBet);
    }
    address[2] memory participants = [g.p1, g.p2];
    GameStarted(participants, gameNumber);
  }

  /**
 * Use this endpoint to make a move during a game
 */
  function makeMove(uint16 gameNumber, uint8 moveNumber) public {
    Game storage g = games[gameNumber];
    require((g.p1 == msg.sender || g.p2 == msg.sender) && moveNumber > 0 && moveNumber <= 3);
    if(g.move == 0) {
      g.move = moveNumber;
    } else {
      address winner;
      if(g.move == moveNumber) {
        g.p1.transfer(g.bet);
        g.p2.transfer(g.bet);
        winner = address(0);
      } else {
        bool win = moveNumber % 3 + 1 != g.move;
        bool p1 = g.p1 == msg.sender;
        winner = (p1 && win || (!p1 && !win)) ? g.p1 : g.p2;
      }
      winner.transfer(2 * g.bet);
      GameComplete(winner, gameNumber);
    }
  }
}
